DROP TABLE IF EXISTS `tb_city_info`;
CREATE TABLE `tb_city_info` (
  `ID` int(8) NOT NULL AUTO_INCREMENT COMMENT '表主键',
  `CITY_CODE` varchar(32) NOT NULL COMMENT '城市项目编码',
  `CITY_NAME` varchar(128) NOT NULL COMMENT '城市项目名称',
  `VERSION` int(8) DEFAULT NULL COMMENT '版本号',
  `MODEL_FLAG` varchar(60) DEFAULT NULL COMMENT '可视模式',
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATOR` varchar(40) DEFAULT NULL COMMENT '创建者',
  `MODIFY_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `UPDATER` varchar(40) DEFAULT NULL COMMENT '更新者',
  `PARENT_CITY_CODE` varchar(100) DEFAULT NULL COMMENT '父级项目编码',
  `MODEL_ORDER` int(3) DEFAULT NULL COMMENT '可视顺序',
  `REMARK` varchar(250) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`) USING BTREE,
  UNIQUE KEY `uniq_city_code` (`CITY_CODE`) USING BTREE COMMENT '城市编码唯一索引',
  KEY `index_parent` (`PARENT_CITY_CODE`) USING BTREE COMMENT '低级编码索引'
) ENGINE=InnoDB AUTO_INCREMENT=3765 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='城市字典编码';

